import React, { useState } from "react";

import { Navbar, Footer, Routes } from "./components";

const App = () => {
    const [darkTheme, setDarkTheme] = useState(false);

    return (
        <div className={darkTheme ? "dark" : ""}>
            <h1>App</h1>
        </div>
    );
};

export default App;
